import React from 'react';
import { Link } from 'react-router-dom'

const Nav = () => {
    return (
      <nav>
        <ul className='navList'>
          <Link to='/' >
            <li className='homeLink'>Home</li>
          </Link>
          <Link to='/todo' >
            <li className='todoLink'>Todo App</li>
          </Link>
          <Link to='wine' >
            <li className='homeLink'>Wine App</li>
          </Link>
        </ul>
      </nav>
    );
}

export default Nav;
